import {Link,useNavigate} from 'react-router-dom'
import { useEffect, useState } from 'react'
import  { getUserprofile } from '../services/user.services'
export default function Display_User(props)
{
    //var result,name,city,state,country,zip,bd,gender
    const[name,setname]=useState([])
    const[city,setcity]=useState([])
    const[state,setstate]=useState([])
    const[country,setcountry]=useState([])
    const[zip,setzip]=useState([])
    const[bd,setbd]=useState([])
    const[gender,setgender]=useState([])
    useEffect(()=>{
        getup(sessionStorage["useremail"])
    })

    async function getup(email)
    {
        //console.log("IN HERE")
        const result=await getUserprofile(email)
        /* name=result[0]+" "+result[1]
        city=result[3]
        state=result[7]
        country=result[4]
        zip=result[5]
        bd=result[2]
        gender=result[6]
        sessionStorage['name']=name
        sessionStorage['city']=city
        sessionStorage['state']=state
        sessionStorage['country']=country
        sessionStorage['zip']=zip
        sessionStorage['bd']=bd */
        setname(result[0]+" "+result[1])
        setbd(result[2])
        setcity(result[3])
        setstate(result[7])
        setcountry(result[4])
        setzip(result[5])
        setgender(result[6])
        //console.log(name)
    }

    return(
        <div>
            <h2>Profile</h2>
            <div>
                <h4>Name:{name}</h4>
                <h4>Email ID:{sessionStorage['useremail']}</h4>
                <h4>City:{city!==null && <div>{city}</div>} {city===null && <div>Profile Not Updated! No City</div>}</h4>
                <h4>State:{state!==null && {state}} {state===null && <div>Profile Not Updated! No State added</div>}</h4>
                <h4>Country:{country!==null && {country}} {country===null && <div>Profile Not Updated! No COuntry added</div>}</h4>
                <h4>Postal Code:{zip!==null && {zip}} {zip===null && <div>Profile Not Updated! No Zip Code added</div>}</h4>
                <h4>Birth Date:{bd!==null && <div>{bd}</div>} {bd===null && <div>Profile Not Updated! No Birth Date added</div>}</h4>
                <h4>Gender:{gender!==null && <div>{gender}</div>} {gender===null && <div>Profile Not Updated! </div>}</h4>
            </div>
        </div>
    )
}
